import Paper from '@material-ui/core/Paper';
import TextField from '@material-ui/core/TextField';

function Uusitilaus () {
    return (
        <div>
            <Paper>
                <form>
                <TextField fullWidth label='Tuote' variant='outlined'/>
                </form>
            </Paper>
        </div>
    )
};
export default Uusitilaus();
